import React from "react";
import { PrimeReactProvider } from "primereact/api";
import { Menubar } from "primereact/menubar";
import AboutMe from "../pages/AboutMe"; // Import AboutMe component
import Experience from "../pages/Experience"; // Import Experience component
import Projects from "../pages/Projects"; // Import Projects component
import "primereact/resources/themes/lara-light-cyan/theme.css";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  useNavigate,
} from "react-router-dom";

function Navbar() {
  const navigate = useNavigate();

  const items = [
    {
      label: "About Me",
      command: () => navigate("/about"),
    },
    {
      label: "Experience",
      command: () => navigate("/experience"),
    },
    {
      label: "Projects",
      command: () => navigate("/projects"),
    },
  ];

  return (
    <PrimeReactProvider>
      <div className="navbar-container">
        <Menubar model={items} />
        <Routes>
       
            <Route path="/about" element={<AboutMe />} />
        
 
            <Route path="/experience" element={<Experience />} />
       
       
            <Route path="/projects" element={<Projects />} />
        
        </Routes>
      </div>
    </PrimeReactProvider>
  );
}
export default Navbar;
